import React from "react";

const table = props => {
  console.log(props.moves);
  console.log("size of the object", props.moves);
  let moves = [];
  let headers = [];
  let dps = null;
  let eps = [];
  for (let key in props.moves) {
    moves.push({ quick_moves: props.moves[key], id: Math.random() });
  }
  console.log("moves are", moves.length);
  dps = moves.map(el => {
    return el.quick_moves.stats.map(stat => {
      console.log(stat.dps);
      return <td> {stat.dps} </td>;
    });
  });
  console.log("dps is", dps);

  eps = moves.map(el => {
    return el.quick_moves.stats.map((stat, index) => {
      return <td>{stat.eps}</td>;
