          {moves.map((el, index) => {
            return <th key={el.id}>Move {index + 1} </th>;
          })}
        </tr>
        <tbody>
          <tr>
            <td>EPS</td>
            {eps}
          </tr>
          <tr>
            <td>DPS</td>
            {dps}
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default table;
